-e30c-4bb2-91da-3cec95f02b0a","collapsed":false,"execution":{"iopub.execute_input":"2023-03-20T01:39:20.964864Z","iopub.status.busy":"2023-03-20T01:39:20.961658Z","iopub.status.idle":"2023-03-20T01:39:21.115006Z","shell.execute_reply":"2023-03-20T01:39:21.112916Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.162537,"end_time":"2023-03-20T01:39:21.11745","exception":false,"start_time":"2023-03-20T01:39:20.954913","status":"completed"},"tags":[]},"outputs":[],"source":["dfdact <- read.csv(\"/kaggle/input/bbfiles/dailyActivity_merged.csv\")\n","dfdint <- read.csv(\"/kaggle/input/bbfiles/dailyIntensities_merged.csv\")\n","dfsday <- read.csv(\"/kaggle/input/bbfiles/sleepDay_merged.csv\")\n"]},{"cell_type":"markdown","id":"31a29dde","metadata":{"_cell_guid":"3d1a74ad-e568-4250-9ab1-673fac2bb971","_uuid":"42fd8827-2f0a-475e-8cad-ab13d0df568a","papermill":{"duration":0.004839,"end_time":"2023-03-20T01:39:21.127221","exception":false,"start_time":"2023-03-20T01:39:21.122382","status":"completed"},"tags":[]},"source":["## Analyzing The Data\n","\n","The business problem is to find trends in Fitbit smart device data usage and see if the trends can be applied to Bellabeat's devices marketing strategy.\n","\n","\n","\n","* I will need to load the relevant r packages."]},{"cell_type":"code","execution_count":2,"id":"828f0a16","metadata":{"_cell_guid":"d1cd7633-790a-4341-9467-ef333fa74bb9","_uuid":"286b2b07-b6c3-45b3-8c24-c7935f00f641","collapsed":false,"execution":{"iopub.execute_input":"2023-03-20T01:39:21.174928Z","iopub.status.busy":"2023-03-20T01:39:21.138555Z","iopub.status.idle":"2023-03-20T01:39:22.516867Z","shell.execute_reply":"2023-03-20T01:39:22.514736Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.387278,"end_time":"2023-03-20T01:39:22.5193","exception":false,"start_time":"2023-03-20T01:39:21.132022","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ──